class OptFDFilter {
  constructor(length = 32, t05 = true) {
    this.table = t05
      ? fractionalDelayFilterTable05[String(length)]
      : fractionalDelayFilterTable09[String(length)]
    this.buf = new Array(this.table[0].length).fill(0)
    this.filter = this.table[0].slice()
    this.length1 = this.table.length - 1
  }

  lookup(fraction) {
    var pos = fraction * this.length1
    var low = Math.floor(pos)
    var high = low + 1
    if (high === this.table.length) {
      this.filter = this.table[this.length1].slice()
      return
    }
    for (var i = 0; i < this.filter.length; ++i) {
      this.filter[i] = this.table[low][i]
        + (pos - low) * (this.table[high][i] - this.table[low][i])
    }
  }

  reset() {
    this.buf.fill(0)
    this.filter = this.table[0].slice()
  }

  push(input) {
    for (var i = this.buf.length - 1; i > 0; --i) {
      this.buf[i] = this.buf[i - 1]
    }
    this.buf[0] = input
  }

  at(fraction) {
    this.lookup(fraction)
    var sig = this.filter[0] * this.buf[0]
    for (var i = 1; i < this.buf.length; ++i) {
      sig += this.filter[i] * this.buf[i]
    }
    return sig
  }

  process(input, fraction) {
    this.push(input)
    return this.at(fraction)
  }
}

class LagrangeNInterp {
  constructor(order) {
    this.N = order
    this.fix = (this.N - 1) / 2
    this.xd = new Array(this.N).fill(0)
    this.diff = new Array(this.N).fill(0)
  }

  reset() {
    this.xd.fill(0)
    this.diff.fill(0)
  }

  push(input) {
    this.diff[0] = input - this.xd[0]
    this.xd[0] = input
    for (var i = 1; i < this.N; ++i) {
      this.diff[i] = this.diff[i - 1] - this.xd[i]
      this.xd[i] = this.diff[i - 1]
    }
  }

  at(fraction) {
    var delta = fraction + this.fix
    var sig = 0

    var i = this.N
    while (i > 0) {
      var next = i - 1
      sig = (next - delta) / i * (this.diff[next] + sig)
      i = next
    }

    return sig + this.xd[0]
  }

  process(input, fraction) {
    this.push(input)
    return this.at(fraction)
  }
}

class Delay {
  // readOrder  writeOrder 
  constructor(sampleRate, time, overSample = 2, readOrder = 1, writeOrder = 1) {
    this.overSample = overSample
    this.sampleRate = this.overSample * sampleRate

    // 
    this.fix = (readOrder - 1 + this.overSample * (writeOrder - 1)) / 2

    this.buf = new Array(Math.ceil(time * this.sampleRate) + 1).fill(0)

    this.rInterp = new LagrangeNInterp(readOrder)
    this.wInterp = new LagrangeNInterp(writeOrder)

    this.wptr = 0
    this.time = time
  }

  set time(value) {
    var delayTime = Math.max(
      this.fix, Math.min(this.sampleRate * value, this.buf.length))
    this.rFraction = delayTime % 1
    this.rptr = Math.ceil(this.wptr - delayTime) + this.fix

    // mod(rptr, buf.length). 
    while (this.rptr < 0) this.rptr += this.buf.length
    this.rptr %= this.buf.length
  }

  reset() {
    this.buf.fill(0)
    this.rInterp.reset()
    this.wInterp.reset()
  }

  process(input) {
    this.wInterp.push(input)

    for (var i = 1; i <= this.overSample; ++i) {
      var wFraction = (this.overSample - i) / this.overSample

      this.buf[this.wptr] = this.wInterp.at(wFraction)
      this.wptr = (this.wptr + 1) % this.buf.length

      this.rInterp.push(this.buf[this.rptr])
      this.rptr = (this.rptr + 1) % this.buf.length
    }

    return this.rInterp.at(this.rFraction)
  }
}

class DelayOpt {
  constructor(sampleRate, time, overSample = 2, filterLength = 8, t05 = true) {
    this.overSample = overSample
    this.sampleRate = this.overSample * sampleRate

    this.buf = new Array(Math.ceil(time * this.sampleRate) + 1).fill(0)

    this.rInterp = new OptFDFilter(filterLength, t05)
    this.wInterp = new OptFDFilter(filterLength, t05)

    this.fix = Math.floor((this.wInterp.table[0].length - 1) / 2)

    this.wptr = 0
    this.time = time
  }

  set time(value) {
    var delayTime = Math.max(
      this.fix, Math.min(this.sampleRate * value, this.buf.length))
    this.rFraction = delayTime % 1
    this.rptr = Math.ceil(this.wptr - delayTime) + this.fix

    // mod(rptr, buf.length). 
    while (this.rptr < 0) this.rptr += this.buf.length
    this.rptr %= this.buf.length
  }

  reset() {
    this.buf.fill(0)
    this.rInterp.reset()
    this.wInterp.reset()
  }

  process(input) {
    this.wInterp.push(input)

    for (var i = 1; i <= this.overSample; ++i) {
      var wFraction = (this.overSample - i) / this.overSample

      this.buf[this.wptr] = this.wInterp.at(wFraction)
      this.wptr = (this.wptr + 1) % this.buf.length

      this.rInterp.push(this.buf[this.rptr])
      this.rptr = (this.rptr + 1) % this.buf.length
    }

    return this.rInterp.at(this.rFraction)
  }
}

